import React, { Component } from 'react';
import "./style.css"
import {Daftar, Home, Login, Product} from '../../pages'


class Body extends Component {
    showPage = () => {
        const { page } = this.props

        if (page === "home")
            return <Home />

        if (page === "product")
            return <Product />

        if (page === "daftar")
            return <Daftar />

        if (page === "login")
            return <Login />
    }
    render() {         
        return ( 
        <>
                {
                    this.showPage()
                }
        </>
        );
    }
}
export default Body;
